import React, {useState,useEffect} from "react";
import {NavLink} from "react-router-dom";
function Main() {

    const [getdata,setdata] = useState([]);
    console.log(getdata);

    const getinput = async(e)=>{
        e.preventDefault();
        
        const res = await fetch("http://localhost:9000/get",{
            method:"GET",
            headers:{
                "Content-Type":"application/json"
            }
            
        });
        const data = await res.json();
        console.log(data);

        if(res.status === 404 || !data){
            
            console.log("error");
        }
        else{
            setdata(data);
            console.log("get data");
        }
    }

    useEffect(()=>{
        getdata();
    },[])



    return (
        <body>
            <div className="mt-20">
                <div>
                    <div class="button_1">
                        <NavLink to="/Add"><button class="bg-fuchsia-700 hover:bg-fuchsia-900 text-white font-bold py-2 px-5 rounded-full ">
                            Add Item
                        </button></NavLink>
                    </div>
                    <br></br><br></br>

                    <div className="flex justify-center " >
                        <table class="w-auto text-sm text-left text-gray-500 dark:text-white  ">
                            <thead class="text-xs text-gray-700 uppercase  dark:bg-neutral-800 dark:text-white">
                                <tr>
                                    <th scope="col" class="text-md px-6 py-3">
                                        Laptop name
                                    </th>
                                    <th scope="col" class="text-md px-6 py-3">
                                        Laptop Model
                                    </th>
                                    <th scope="col" class="text-md px-6 py-3">
                                        Stock Count
                                    </th>
                                    
                                    <th scope="col" class="text-md px-20 py-3">
                                        Actions
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr class="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
                                    <th scope="row" class="text-md px-6 py-3 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                                        Hp Gaming Series
                                    </th>
                                    <td class="text-md px-6 py-3">
                                        Pavilion
                                    </td>
                                    <td class="text-md px-6 py-3">
                                        10
                                    </td>
                                    
                                    <td class="text-md px-6 py-3 flex space-x-4">
                                        <NavLink to="/View"><button className="bg-fuchsia-700 hover:bg-fuchsia-900 text-white font-bold py-1 px-3 rounded-full ">View</button></NavLink>
                                        <NavLink to ="/Edit"><button className="bg-fuchsia-700 hover:bg-fuchsia-900 text-white font-bold py-1 px-3 rounded-full ">Update</button></NavLink>
                                        <button className="bg-fuchsia-700 hover:bg-fuchsia-900 text-white font-bold py-1 px-3 rounded-full ">Delete</button>
                                    </td>
                                </tr>
                                
                            </tbody>
                        </table>
                    </div>



                </div>

            </div>

        </body>
    );
}
export default Main;
